 threads_per_worker=1)\n    print(client)\n\n    df = dask.datasets.timeseries(\n        start=\"2000-01-01\",\n        end=\"2000-01-31\",\n        # end=\"2000-12-31\",\n        partition_freq=\"1h\",\n        freq=\"60s\",\n    )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.time()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.time()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.time()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.time()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.time()\n            df2.head()\n            stop = time.time()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    data = dsa.random.random((10000, 1000000), chunks=(1, 1000000))\n    da = xr.DataArray(data, dims=['time', 'x'],\n                      coords={'day': ('time', np.arange(10000) % 100)})\n    clim = da.groupby('day').mean(dim='time')\n    anom = da.groupby('day') - clim\n    anom_mean = anom.mean(dim='time')\n    with performance_report(filename=f\"{today}-anom-mean-scheduler.html\"):\n        anom_mean_t = []\n        for i in range(iterations):\n            start = time.time()\n            anom_mean.compute()\n            stop = time.time()\n            anom_mean_t.append(stop-start)\n\n        anom_mean_t = np.array(anom_mean_t)\n\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access,\n            anom_mean=anom_mean_t)\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{"factors":["a","b"]},"id":"1152","type":"FactorRange"},{"attributes":{"active_drag":"auto","active_inspect":"auto","active_multi":null,"active_scroll":"auto","active_tap":"auto","logo":null,"tools":[{"id":"1208"}]},"id":"1197","type":"Toolbar"},{"attributes":{"below":[{"id":"1081"}],"center":[{"id":"1084"},{"id":"1088"}],"left":[{"id":"1085"}],"renderers":[{"id":"1102"}],"sizing_mode":"stretch_both","title":{"id":"1222"},"toolbar":{"id":"1094"},"x_range":{"id":"1073"},"x_scale":{"id":"1077"},"y_range":{"id":"1075"},"y_scale":{"id":"1079"}},"id":"1072","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"1188","type":"CategoricalScale"},{"attributes":{"data":{"bandwidth":[],"bandwidth-half":[],"bandwidth_text":[],"type":[]},"selected":{"id":"1277"},"selection_policy":{"id":"1276"}},"id":"1178","type":"ColumnDataSource"},{"attributes":{"formatter":{"id":"1240"},"ticker":{"id":"1051"},"visible":false},"id":"1050","type":"LinearAxis"},{"attributes":{"source":{"id":"1106"}},"id":"1131","type":"CDSView"},{"attributes":{"fill_color":{"value":"blue"},"height":{"units":"data","value":1},"line_color":{"value":"blue"},"width":{"field":"bandwidth","units":"data"},"x":{"field":"bandwidth-half"},"y":{"field":"type"}},"id":"1199","type":"Rect"},{"attributes":{},"id":"1005","type":"DataRange1d"},{"attributes":{},"id":"1244","type":"CategoricalTickFormatter"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Name:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-family: Monaco, mo
